import React, { useState } from 'react';
import axios from 'axios';

function Side_work() {
  const [userdata, setUserdata] = useState([]);

  const fetchData = async () => {
    try {
      const response = await axios.get('https://picsum.photos/v2/list?page=2&limit=20');
      setUserdata(response.data); // store data in state
      console.log('Fetched data:', response.data); // print data in console
    } catch (error) {
      console.error('Error fetching data:', error);
    }
  };

  return (
    <div className='d-flex justify-content-center align-items-center mt-5'>
      <button onClick={fetchData} className='btn btn-danger'>
        Fetch Data
      </button>
      {fetchData}
    </div>
  );
}

export default Side_work;
